import './menu-item.styles.scss';

const MenuItem = ({title}) => (
    <div style={{
        backgroundImage: `url(${imageUrl})`
    }} className='menu-item'>
        <div className='content'>
            <h1>{title}</h1>
            <span>Shop Now</span>
        </div>
    </div>
)

export default MenuItem;
